        tokenContract.transferFrom(msg.sender, address(this), tokenAmount);
        assetRecords[UAI].assetStake += tokenAmount;

        assetRecords[UAI].assertions.push(assertionId);

        emit AssetUpdated(UAI, assertionId);
    }


